import Counter from './components/Counter'; 
import { createStore } from "redux"; 
import CounterReducer from './Redux/reducers/counterReducer'; 
import {BrowserRouter,Routes,Route } from 'react-router-dom';
import App from './App';
import './index.css';
import PageAPI from './Components2/PageAPI';
import PageForm from'./Components2/PageForm';
import PageIncrement from'./Components2/PageIncrement';
//The created store--------
const store = createStore( CounterReducer,); 

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
     <Routes>
          <Route  path='/' element={<App/>} />
          <Route  path='/PageAPI' element={<PageAPI/>} />
          <Route  path='/PageForm' element={<PageForm/>} />
          <Provider store={store}>

          </Provider>
          <Route  path='/PageIncrement' element={<PageIncrement/>} />
    </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();
